import logo from './logo.svg';
import './App.css';

function App() {
  const product=[
    {id:3 ,title:"watch",price:10000,category:"electronics", rating:4},
    {id:4 ,title:"phone",price:500000,category:"electronics", rating:5},
    {id:5 ,title:"laptop",price:1000000,category:"electronics", rating:3},
    {id:6 ,title:"tshirt",price:3000,category:"cloths", rating:4}
  ]
  return (
   <productCrad id={product.id} title={product.title} price={product.price} category={product.category} rating={product.rating}/>
  );
}

export default App;
